import logo from "./logo.svg";
import "./App.css";
import {
  Button,
  Icon,
  Menu,
  Header,
  Image,
  Sidebar,
  Segment
} from "semantic-ui-react";
import React, { Component } from "react";
import ProfilePic from "./raghu.jpg";

class App extends Component {
  handleItemClick = (e, { name }) => this.setState({ activeItem: name });
  render() {
    return (
      <div className="background-image App App-header">
        <Sidebar.Pushable as={Segment}>
          {vertical ? (
            <HorizontalSidebar
              animation={animation}
              direction={direction}
              visible={visible}
            />
          ) : null}
          {vertical ? null : (
            <VerticalSidebar
              animation={animation}
              direction={direction}
              visible={visible}
            />
          )}

          <Sidebar.Pusher dimmed={dimmed && visible}>
            <Segment basic>
              <Header as="h3">Application Content</Header>
              <Image src="/images/wireframe/paragraph.png" />
            </Segment>
          </Sidebar.Pusher>
        </Sidebar.Pushable>
        <Image centered src={ProfilePic} size="medium" circular bordered />
        <Header icon as="h1" style={{ color: "white" }}>
          <Header.Content>Shri Raghu Raaman</Header.Content>
        </Header>
      </div>
    );
  }
}

export default App;
